import React, {Component} from 'react';

export class AutoClick extends Component {
  constructor(props) {
    super(props)
    this.state = {
      tier: 1,
      cost: 10,
      buttonDisabled: true,
      effectEnabled: false
      }
  }

  autoPoke = () => {
    this.setState({
      autoClick: {
        tier: this.state.tier + 1,
        buttonDisabled: true,
        effectEnabled: true
      }
    })
  }

  render() {
    return (
      <button onClick={this.autoPoke} disabled={this.state.buttonDisabled}>Auto Poke {this.state.tier}</button>
    )
  }
}
